window.bookSummaryJSON = "<p><b>Everything we’ve been through comes down to this.</b><br> <br> Against all odds, Calla is adjusting to her new life alongside the vampires who brought her into the supernatural world.<br> <br> As they work to bring longtime enemies together, to forge a better future for vampires and humans alike, they must find a way to mend the rifts created long before Calla even existed.<br> <br> But the rocky relationship between the vampires and those who hunt them isn’t the only threat. An ancient dynasty of vampires close to them is hellbent on destroying their peace and the life Calla has built with her mates.<br> <br> And she will do whatever it takes to make it last forever, because if she fails, they’ll lose everything they’ve worked for, their hearts, and even their lives.<br> <br> <i>Raptured by Eternity</i> is the sixth and final installment in the addictively sexy, reverse harem <i>Blood Oath</i> series!<br> <br> <b>SERIES READING ORDER:</b><br> Book 1: <i>Bound in Crimson</i><br> Book 2: <i>Tempted by Fire</i><br> Book 3: <i>Entangled in Scarlet</i><br> Book 4: <i>Fated in Ruby</i><br> Book 5: <i>Unraveled by Desire</i><br> Book 6: <i>Raptured by Eternity</i></p>"; 
